You can calculate the variance by taking the mean squared error (MSE) and subtracting the expected value. The MSE is calculated as follows:

\begin{code}
MSE = 1/N * Sum(x_i - x)^2
\end{code}

where N is the number of samples, x_i are your training data points, and x is the predicted output for each point. Once you have the MSE, simply take the average to get the variance.

