function arePrimes(nums) {
    for (let i = 0; i < nums.length - 1; ++i) {
        for (let j = i + 1; j < nums.length; ++j) {
            if (nums[i] === nums[j]) return false;
            else if (nums[i] % nums[j] == 0) return false;
        }
    }
}

