function isPrimeNumber(arr) {
  for(let i = 0; i < arr.length; i++) {
    let num = arr[i];
    let isPrime = true;

    // Check if num is divisible by any number from 2 to num - 1
    for(let j = 2; j < num; j++) {
      if(num % j === 0) {
        isPrime = false;
        break;
      }
    }
    // If num is prime, print it to the console
    if(isPrime) {
      console.log(num);
    }
  }
}

